@elvazleta @AdrianDeLaGarza Sí, chaira del pri. Como lo mostré en el otro tuit: "Se trata de que esté unido... con el que me gusta".

Ande, siga mintiéndose. Y victimizándose. Y echándole la culpa a los demás de su propia incompetencia, muy al estilo del viejo pri. Sin sorpresas.

Saludines.
